import axios from 'axios'

export async  function PostComplient(Complient){

    console.log(Complient)

    try{
        const response = await axios.post("http://localhost:2500/api/complient",{"provider": Complient,"email": email,"password": password});
        console.log(response)
        return response;
    }
    catch(error){
        return error.response
    }

}
